            return ""

        modified_string = "@#" + "#".join(self.input_string) + "#$"
        p = [0] * len(modified_string)
        center = right = 0

        for i in range(1, len(modified_string) - 1):
            mirror = 2 * center - i
            if right > i:
                p[i] = min(right - i, p[mirror])
            while modified_string[i + 1 + p[i]] == modified_string[i - 1 - p[i]]:
                p[i] += 1
            if i + p[i] > right:
                center, right = i, i + p[i]

        max_length = max(p)
        center_index = p.index(max_length)
        start = (center_index - max_length) // 2
        return self.input_string[start:start + max_length]
